	public function index()
	{

		$this->check_login();
			
		$room_types = $this->room_m->get_room_types();
		$viewdata = array('room_types' => $room_types);
		$data = array('title' => 'Reservation - ', 'page' => 'reservation');
		$this->load->view('header', $data);
		$this->load->view('reservation/add', $viewdata);
		$this->load->view('footer');
	}
	public function make()
	{
		$this->check_login();

		$post = $this->input->post();

		$customer = $this->customer_m->get_customer($post['customer_TCno']);
		$customer = $customer[0];
		$viewdata = array();
		$data = array();
		$data['customer_id'] = $customer->customer_id;
		$data['room_id'] = $post['room_id'];
		$data['checkin_date'] = $post['checkin_date'];
		$data['checkout_date'] = $post['checkout_date'];
		$data['payment_method'] = $post['payment_method'];
		$data['employee_id'] = UID;
		$data['time_in'] = date('h:i A');
		$data['status'] = 'in';

		$date = new DateTime();
		$date_s = $date->format('Y-m-d');
		if($date_s>$data['checkin_date']) {
			$viewdata['error'] = "Checkin can't be before then today";
		} else {
			$this->reservation_m->add_reservation($data);
			$this->room_m->add_room_sale($data, $date_s);
			$viewdata['success'] = 'Reservation successfully made';
		}

		$room_types = $this->room_m->get_room_types();
		$viewdata['room_types'] = $room_types;

		$data = array('title' => 'Reservation - ', 'page' => 'reservation');
		$this->load->view('header', $data);
		$this->load->view('reservation/add', $viewdata);
		$this->load->view('footer');
	}

public function checkout($reservation_id){
		$this->check_login();

		$status = 'out';
		$time_out = date('h:i A');

		$select_reserve = $this->reservation_m->getReservation($reservation_id);

		

		$this->reservation_m->updateReservation($reservation_id, $status, $time_out, $select_reserve[0]->room_id);
		redirect("/customer/active");
	
		
		
		$this->load->view('customer/active',$viewdata);

		$this->load->view('footer');
}
function delete($reserve_id)
	{
		$this->reservation_m->deleteReservation($reserve_id);
		redirect("/customer/all_reservation");
	}
public function edit($reserve_id)
	{
		$this->check_login();

		if($this->input->post("checkout_date") || $this->input->post("status"))
		{
			$extend = $this->input->post("checkout_date");
			$status = $this->input->post("status");
			if(isset($extend)){
				$time_out = '';
			}
			elseif($status == 'out'){
				$time_out = date('h:i A');
			}
			
			
			$this->reservation_m->editReservation($reserve_id, $extend, $status, $time_out);
			redirect("/customer/active");
		}
		$reservations = $this->reservation_m->getReservation($reserve_id);
		$customer = $this->customer_m->getCustomer($reservations[0]->customer_id);

		
		$data = array('title' => 'Update Reservation - ', 'page' => 'reservation');
		$this->load->view('header', $data);

		// print_r(($attendances[0]));
		
		$viewdata = array('reservation' => $reservations[0], 'customer'=> $customer[0]);
		
		$this->load->view('reservation/edit',$viewdata);

		$this->load->view('footer');
	}
	
}

